import React from "react";
import { BrowserRouter } from "react-router-dom";
import Routes from "./helpers/Routes";
import Navbar from "./components/Navbar/Navbar";

function App() {
  return (
    <BrowserRouter>
      <Navbar />
      <Routes />
    </BrowserRouter>
  );
}

export default App;
